import * as THREE from "three";

class ImageData {
  static emoji_30Small =
    "";
  static emoji_atlas1 = "";
}

class Tiles {
  constructor() {
    const loader = new THREE.TextureLoader();
    const base64PreFix = "data:image/jpeg;base64,";
    this.tileTexture = loader.load(base64PreFix + ImageData.emoji_30Small);
    this.tileTexture.wrapS = THREE.RepeatWrapping;
    this.tileTexture.wrapT = THREE.RepeatWrapping;
    // Todo: for tiling (see Texture.repeat) and wrapping to work, the texture needs to be a power of 2
    // See here for details: https://threejs.org/docs/#api/en/textures/Texture

    this.tileTextureAtlas = loader.load(base64PreFix + ImageData.emoji_atlas1);
    this.tileTextureAtlas.wrapS = THREE.RepeatWrapping;
    this.tileTextureAtlas.wrapT = THREE.RepeatWrapping;
  }
}

export { Tiles };
